sidder hjemme i skjulet stadig er i live. \\nDerfor har han besluttet sig for at vende tilbage til sine evner som spion/agent og forhåbentligt gøre en forskel ved at gå efter mere strategiske mål som har indflydelse. Folk som korrupte politikere, bandit ledere og deslige\\n\\nSit kaldenavn \\logseq____&quot;[[Lark]]\\logseq____&quot; fik han som barn som kodenavn hos sin kontakt fordi han var god til at imitere fuglelyde/sang og holdt til i skovenlogseq____&quot;,536870919]],[logseq____&quot;^17logseq____&quot;,[802,logseq____&quot;^Qlogseq____&quot;,logseq____&quot;^24logseq____&quot;,536870919]],[logseq____&quot;^17logseq____&quot;,[802,logseq____&quot;^Glogseq____&quot;,797,536870919]],[logseq____&quot;^17logseq____&quot;,[802,logseq____&quot;^Zlogseq____&quot;,24,536870919]],[logseq____&quot;^17logseq____&quot;,[802,logseq____&quot;^Xlogseq____&quot;,24,536870919]],[logseq____&quot;^17logseq____&quot;,[802,logseq____&quot;^Wlogseq____&quot;,24,536870919]],[logseq____&quot;^17logseq____&quot;,[802,logseq____&quot;^Wlogseq____&quot;,793,536870919]],[logseq____&quot;^17logseq____&quot;,[802,logseq____&quot;^@logseq____&quot;,[logseq____&quot;^ logseq____&quot;,logseq____&quot;^38logseq____&quot;,3],536870919]],[logseq____&quot;^17logseq____&quot;,[802,logseq____&quot;^Llogseq____&quot;,[],536870919]],[logseq____&quot;^17logseq____&quot;,[802,logseq____&quot;^Ilogseq____&quot;,24,536870919]],[logseq____&quot;^17logseq____&quot;,[802,logseq____&quot;^Ilogseq____&quot;,793,536870919]],[logseq____&quot;^17logseq____&quot;,[802,logseq____&quot;^31logseq____&quot;,true,536870919]],[logseq____&quot;^17logseq____&quot;,[802,logseq____&quot;^logseq____&lt;logseq____&quot;,logseq____&quot;~u64fa2848-de31-4980-8950-6d2e031d7cd1logseq____&quot;,536870919]],[logseq____&quot;^17logseq____&quot;,[803,logseq____&quot;^Slogseq____&quot;,logseq____&quot;Drinks human bloodlogseq____&quot;,536870919]],[logseq____&quot;^17logseq____&quot;,[803,logseq____&quot;^Qlogseq____&quot;,logseq_       // This script checks to see if a redirect is present in the query string
      // and converts it back into the correct url and adds it to the
      // browser's history using window.history.replaceState(...),
      // which won't cause the browser to attempt to load the new url.
      // When the single page app is loaded further down in this file,
      // the correct url will be waiting in the browser's history for
      // the single page app to route accordingly.
      (function(l) {
        if (l.search) {
          var q = {};
          l.search.slice(1).split('&').forEach(function(v) {
            var a = v.split('=');
            q[a[0]] = a.slice(1).join('=').replace(/~and~/g, '&');
          });
          if (q.p !== undefined) {
            window.history.replaceState(null, null,

              (q.q ? ('?' + q.q) : '') +
              l.hash
            );
